const HomepageBody = () => {
  return (
    <>
      <div className="homepage-categories">
        <div className="categories-card">
          <img src="money-bag.png" alt="" />
        </div>
        <div className="categories-card"></div>
        <div className="categories-card"></div>
        <div className="categories-card"></div>
        <div className="categories-card"></div>
      </div>
      <div className="homepage-videos flex-r-w">
        <div className="homepage-videos-cards">6</div>
        <div className="homepage-videos-cards">6</div>
        <div className="homepage-videos-cards">6</div>
        <div className="homepage-videos-cards">6</div>
      </div>
    </>
  );
};

export { HomepageBody };
